import { Injectable } from '@angular/core';

@Injectable({
    providedIn: 'root',
})

export class FontMontserrat {

bold = '';

normal = '';

light = ''
    getFonts() {
        return [{style: 'normal', font: this.normal, addFileToVFS:'Montserrat-Normal-normal.ttf', addFontP1:'Montserrat-Normal-normal.ttf', addFontP2:'Montserrat-Normal', addFontP3:'normal'}, {style: 'bold', font: this.bold, addFileToVFS:'Montserrat-Bold-bold.ttf', addFontP1:'Montserrat-Bold-bold.ttf', addFontP2:'Montserrat-Bold', addFontP3:'bold'}, {style: 'light', font: this.light, addFileToVFS:'Montserrat-Light-light.ttf', addFontP1:'Montserrat-Light-light.ttf', addFontP2:'Montserrat-Light', addFontP3:'light'}];
    }
}